import React from "react";
import { useState } from "react";

const SideNavbar = ({ setInputType, inputType }) => {
  return (
    <div className="flex flex-col gap-4 p-2">
      <div
        className="cursor-pointer"
        onClick={setInputType("about")}
        style={{ backgroundColor: inputType === "about" ? "red" : "white" }}
      >
        About
      </div>
      <div
        className="cursor-pointer"
        onClick={setInputType("education")}
        style={{ backgroundColor: inputType === "education" ? "red" : "white" }}
      >
        Education
      </div>
      <div
        className="cursor-pointer"
        onClick={setInputType("experience")}
        style={{
          backgroundColor: inputType === "experience" ? "red" : "white",
        }}
      >
        Experience
      </div>
      <div
        className="cursor-pointer"
        onClick={setInputType("projects")}
        style={{ backgroundColor: inputType === "projects" ? "red" : "white" }}
      >
        Projects
      </div>
      <div
        className="cursor-pointer"
        onClick={setInputType("skill")}
        style={{ backgroundColor: inputType === "skill" ? "red" : "white" }}
      >
        Skills
      </div>
      <div
        className="cursor-pointer"
        onClick={setInputType("achivement")}
        style={{ backgroundColor: inputType === "about" ? "red" : "white" }}
      >
        Achivement
      </div>
    </div>
  );
};

export default SideNavbar;
